import React from 'react';
import Form from '../../Form/Form';

class Home extends React.Component {



    render() {
        return (
            <div className='container'>
                <div className='row'>
                    <div className='col-3'>
                    </div>
                    <div className='col-6'>
                        <Form
                            onSubmit={this.onSearchSubmit}
                        />
                    </div>
                    <div className='col-3'>
                    </div>
                </div>
            </div>
        )
    }
}

export default Home
